import React from 'react';
import { useNavigate } from 'react-router-dom';

const ReservarTaller = () => {
  const navigate = useNavigate();

  // Estilos en objeto
  const styles = {
    mainContainer: {
      display: 'flex',
      flexDirection: 'column',
      minHeight: '100vh',
      backgroundColor: '#FAFAFA',
      fontFamily: "'Century Gothic', Arial, sans-serif"
    },
    nav: {
      backgroundColor: '#6B8E23',
      padding: '15px 20px',
      display: 'flex',
      justifyContent: 'space-around',
      boxShadow: '0 2px 10px #FAFAFA'
    },
    navButton: {
      color: '#FAFAFA',
      background: 'none',
      border: 'none',
      fontWeight: '600',
      cursor: 'pointer',
      padding: '8px 15px',
      borderRadius: '5px',
      transition: 'all 0.3s'
    },
    contentContainer: {
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      flex: 1,
      padding: '20px'
    },
    card: {
      width: '100%',
      maxWidth: '450px',
      border: '3px solidrgb(201, 214, 91)',
      borderRadius: '12px',
      overflow: 'hidden',
      boxShadow: '0 10px 25px -5px rgba(227, 215, 215, 0.15)'
    },
    header: {
      backgroundColor: '#065f46',
      color: '#FFF3E2',
      padding: '20px',
      textAlign: 'center',
      textTransform: 'uppercase',
      letterSpacing: '1.2px'
    }
  };

  // Navegación entre páginas
  const handleNavigation = (path) => {
    navigate(path);
  };

  return (
    <div style={styles.mainContainer}>
      {/* Menú de navegación */}
      <nav style={styles.nav}>
        <button 
          style={styles.navButton}
          onClick={() => handleNavigation('/')}
          onMouseEnter={(e) => e.target.style.backgroundColor = '#FAFAFA'}
          onMouseLeave={(e) => e.target.style.backgroundColor = 'transparent'}
        >
          Inicio
        </button>
        <button 
          style={styles.navButton}
          onClick={() => handleNavigation('/talleres')}
          onMouseEnter={(e) => e.target.style.backgroundColor = '#FAFAFA'}
          onMouseLeave={(e) => e.target.style.backgroundColor = 'transparent'}
        >
          Talleres
        </button>
        <button 
          style={styles.navButton}
          onClick={() => handleNavigation('/reservas')}
          onMouseEnter={(e) => e.target.style.backgroundColor = '#FAFAFA'}
          onMouseLeave={(e) => e.target.style.backgroundColor = 'transparent'}
        >
          Mis Reservas
        </button>
        <button 
          style={styles.navButton}
          onClick={() => handleNavigation('/perfil')}
          onMouseEnter={(e) => e.target.style.backgroundColor = '#FAFAFA'}
          onMouseLeave={(e) => e.target.style.backgroundColor = 'transparent'}
        >
          Perfil
        </button>
      </nav>

      {/* Contenido centrado */}
      <div style={styles.contentContainer}>
        <div style={styles.card}>
          <div style={styles.header}>
            <h1 style={{ margin: 0, fontSize: '22px', fontWeight: 'bold' }}>
              RESERVAR TALLER
            </h1>
          </div>
          
          <div style={{ padding: '25px', backgroundColor: 'white' }}>
            <div style={{ marginBottom: '25px' }}>
              <h2 style={{
                fontSize: '18px',
                fontWeight: '600',
                color: '#666666',
                marginBottom: '10px',
                borderBottom: '2px solidrgb(139, 103, 78)',
                paddingBottom: '8px'
              }}>
                Taller de Cocina Italiana
              </h2>
              <p style={{
                color: '#64748b',
                lineHeight: '1.6',
                margin: 0
              }}>
               ESCRIBIR ALGO AQUI..
              </p>
            </div>
            
            <button
              style={{
                width: '100%',
                backgroundColor: 'PINK',
                color: 'white',
                border: 'none',
                padding: '12px',
                borderRadius: '8px',
                fontWeight: 'bold',
                fontSize: '16px',
                cursor: 'pointer',
                transition: 'background-color 0.3s',
                textTransform: 'uppercase'
              }}
              onMouseEnter={(e) => e.target.style.backgroundColor = '#047857'}
              onMouseLeave={(e) => e.target.style.backgroundColor = '#059669'}
            >
              Confirmar Reserva
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ReservarTaller;
